import React from 'react';

class Home extends React.Component {
	constructor(props) {
		super(props);
		this.state = {message: "hello!"};
	}

	handleClick = () => {
		alert(this.state.message);
	}

	render() {
		return (
			<button onClick={this.handleClick}>
				Say hello
			</button>
		);
	}

}
